import styled from "styled-components";

import { ReactComponent as Declined_ } from "../assets/declined.svg";
import { ReactComponent as Approved_ } from "../assets/approved.svg";
import { ReactComponent as Waiting_ } from "../assets/waiting.svg";
import { ReactComponent as Total_ } from "../assets/total.svg";
import { ReactComponent as User_ } from "../assets/user.svg";

export const DeclinedIcon = styled(Declined_)`
  padding: 0 0 10px;
  border-radius: 2px;
  box-shadow: 0 2px 7px 0 rgba(0, 0, 0, 0.15);
  background-color: #e25e5e;
`;
export const ApprovedIcon = styled(Approved_)`
  border-radius: 2px;
  box-shadow: 0 2px 7px 0 rgba(0, 0, 0, 0.15);
  background-color: #41d94e;
`;
export const WaitingIcon = styled(Waiting_)`
  padding: 0 0 8px;
  border-radius: 2px;
  box-shadow: 0 2px 7px 0 rgba(0, 0, 0, 0.15);
  background-color: #fc913f;
`;
export const TotalIcon = styled(Total_)`
  padding: 0 0 10px 1px;
  border-radius: 2px;
  box-shadow: 2px 2px 7px 0 rgba(0, 0, 0, 0.15);
  background-color: #1890ff;
`;
